    evolutionary_distance FLOAT
);

CREATE TABLE Species (
    species_id INT PRIMARY KEY,
    species_name VARCHAR(255) NOT NULL,
    species_type VARCHAR(50) NOT NULL
);

CREATE TABLE PhylogeneticTree (
    tree_id INT PRIMARY KEY,
    species_id INT NOT NULL,
    tree_description TEXT,
    FOREIGN KEY (species_id) REFERENCES Species(species_id)
);

CREATE TABLE GeneticData (
    data_id INT PRIMARY KEY,
    tree_id INT NOT NULL,
    genetic_sequence TEXT,
    FOREIGN KEY (tree_id) REFERENCES PhylogeneticTree(tree_id)
);

CREATE TABLE EvolutionaryDistance (
    distance_id INT PRIMARY KEY,
    tree_id INT NOT NULL,
    distance_value FLOAT NOT NULL,
    FOREIGN KEY (tree_id) REFERENCES PhylogeneticTree(tree_id)
);

CREATE TABLE Species (
	species_id INT PRIMARY KEY,
	species_name VARCHAR(255) NOT NULL,
	species_type VARCHAR(50) NOT NULL
);

CREATE TABLE Genus (
	genus_id INT PRIMARY KEY,
	genus_name VARCHAR(255) NOT NULL,
	founding_year INT
);

CREATE TABLE Family (
	family_id INT PRIMARY KEY,
	family_name VARCHAR(255) NOT NULL,
	number_of_species INT
);

CREATE TABLE Order (
	order_id INT PRIMARY KEY,
	order_name VARCHAR(255) NOT NULL,
	location_id INT
);
